import React from 'react';
import img3 from '../image/img-3.png';
import './SectionTwo.css';

export default class SectionTwo extends React.Component {
  render() {
    return (
      <div className='sectiontwo'>
        <div className='box'>
          <div className='boximg'>
            <img src={img3} />
          </div>
        </div>
      </div>
    );
  }
}
